import React from 'react';

class Cakes extends React.Component{
  render(){
    return(
      <div id="east" className="column effect-hover"><a href="#Cakebar">
      <div className="content">
        {/* <i className="fa fa-mars" aria-hidden="true"></i> */}
        <h2>Samar's<span>Cake</span></h2>
        <h3>Vist the wonderland</h3>
        <p className="msgcake">Try our Cake</p>
      </div>
      </a>			
    </div>

    )
  }
}

export default Cakes;
